module filter_top (
	Clk, 
	Reset, 
	Din, 
	Dout, 
	SCK, 
	CS, 
	MOSI, 
	MISO);
   input Clk;
   input Reset;
   input [11:0] Din;
   output [11:0] Dout;
   input SCK;
   input CS;
   input MOSI;
   output MISO;

   // Internal wires
   wire FE_PHN593_Din_5;
   wire FE_PHN590_Din_0;
   wire FE_PHN589_Din_2;
   wire FE_PHN588_Din_1;
   wire FE_OFN282_register_value_1;
   wire FE_OFN275_register_value_8;
   wire FE_OFN272_register_value_11;
   wire [7:0] register_address;
   wire [7:0] read_address;
   wire [11:0] register_value;
   wire [11:0] read_value;
   wire load;

   DLY1X1 FE_PHC593_Din_5 (.Y(FE_PHN593_Din_5),
	.A(Din[5]));
   DLY1X1 FE_PHC590_Din_0 (.Y(FE_PHN590_Din_0),
	.A(Din[0]));
   DLY1X1 FE_PHC589_Din_2 (.Y(FE_PHN589_Din_2),
	.A(Din[2]));
